(function(){"use strict";var n=angular.module("myApp");n.controller("ModalCtrl",function(n,t){n.open=function(){var i=t.open({templateUrl:"/views/modalContent.html",controller:"ModalContentCtrl",size:""});i.result.then(function(t){n.result=`${t} button hitted`})}});n.controller("ModalContentCtrl",function(n,t,i){n.result={};n.save=function(r,u){u.$valid&&t.post("api/dashboard",r).then(function(t){n.result=t.data;i.close("Ok")})};n.cancel=function(){i.dismiss()}})})();